import React, { Component, Fragment} from 'react'

import Drawer from '@material-ui/core/Drawer'
import Fab from '@material-ui/core/Fab'
import MenuIcon from '@material-ui/icons/Menu'

import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';

import HomeIcon from '@material-ui/icons/Home';

class loading extends Component {
  constructor(props) {
    super(props)
    this.state = { 
      drawerIsOpen:false,
    }
  }

  render() {
    let menu = null

    if(this.props.user == null)
    {
      menu = {

      }
    }
    else
    {
      menu = (
        <List>
          <ListItem button>
            <ListItemIcon><HomeIcon /></ListItemIcon>
            <ListItemText primary='Inicio' />
          </ListItem>
          <ListItem button>
            <ListItemIcon><HomeIcon /></ListItemIcon>
            <ListItemText primary='Favoritos' />
          </ListItem>
          <ListItem button>
            <ListItemIcon><HomeIcon /></ListItemIcon>
            <ListItemText primary='Historial pedidos' />
          </ListItem>
        </List>
      )
    }

    return (
      <div>
        <Fab size="small" aria-label="menu" onClick={() => this.setState({drawerIsOpen:true})} style={{position:"fixed", top:"15px", left:"15px"}}>
          <MenuIcon />
        </Fab>
        <Drawer anchor='left' open={this.state.drawerIsOpen} onClose={()=>this.setState({drawerIsOpen:false})}>
          {menu}
        </Drawer>

        {this.props.children}

      </div>
    )
  }
}

export default loading;
